INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (13, 'Action Agenda Coordination Committee', 'act@aegee.org', NULL, 'Notelaarsstraat 55', 'The Action Agenda Coordination Committee (ACT) supports locals and European Bodies to implement the Action Agenda, which states the goals that we as an organisation want to achieve for our Focus Areas.', 'QAA', '2018-05-02 21:58:54.760566', '2018-05-03 08:49:24.257251', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (4, 'Juridical Commission', 'juridical@aegee.org', NULL, 'Notelaarsstraat 55', 'Since 1987 the Juridical Commission of AEGEE-Europe has been providing the whole Association with the most reliable sources of information as well as with internal legal consultancy. For all these years, the Commission has earned it''s place as the most important partner of the Comité Directeur and the Agora’s most trusted advisor.', 'XJU', '2018-05-02 20:08:21.966783', '2018-05-02 20:08:21.966792', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (5, 'Mediation Commission', 'medcom@aegee.org', NULL, 'Notelaarsstraat 55', 'The Mediation Commission (former Members Commission) acts in case a dispute occurs between members of AEGEE-Europe (locals, AEGEE-Academy), and is responsible for making decisions in these cases, occasionally leading to disciplinary sanctions against the ordinary member (local) of AEGEE-Europe. After carrying out an investigation, the Mediation Commission can suggest sanctions (including expulsion of a local from the Network) to be applied by the Comité Directeur and after by ratification of the Agora. In other words, in case there is a violation of the CIA, financial regulations, national law etc. by the ordinary member, the MedCom is activated.', 'XME', '2018-05-02 20:20:21.296668', '2018-05-02 20:20:21.296676', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (6, 'Network Commission', 'netcom@aegee.org', NULL, 'Notelaarsstraat 55', 'The Network Commission consists of up to eleven members elected by the Agora for the duration of twelve months. It’s primary tasks are to ensure the smooth functioning of the AEGEE locals that form the Network, and to enhance the internal communication both within the Network itself, and between the Network and AEGEE-Europe. Each Network Commissioner should always act in the interest of the Network as a whole, be a trusted source of information and give the best example of an active AEGEE member.', 'XNE', '2018-05-02 20:24:50.296874', '2018-05-02 20:24:50.296884', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (7, 'AEGEE-Academy', 'board@aegee-academy.org', NULL, 'Achter St.-Pieter 25, 3512HR Utrecht', 'AEGEE-Academy is the official pool of trainers of AEGEE, where we train AEGEEans in various skills that prepare them for their working life, their AEGEE life and contribute to their self-development. We provide training activities, experienced trainers and feedback on session designs for every type of local or international activity in AEGEE. We also train trainers and anyone that can benefit from knowledge on non-formal education methodologies on how to incorporate them in their activities. This way we help building a stronger network, where non-formal education is the key.', 'XIE', '2018-05-02 20:31:57.492188', '2018-05-02 20:31:57.492196', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (3, 'Audit Commission', 'audit@aegee.org', NULL, 'Notelaarsstraat 55', 'Entitled AEGEE body of financially competent members for auditing, checking, reporting, improving and investigating on the finances of AEGEE-Europe and AEGEE Locals within our Organisation.', 'XAU', '2018-05-02 19:59:32.398314', '2018-05-02 20:57:49.540424', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (22, 'Public Relations Committee', 'prc@aegee.org', NULL, 'Notelaarsstraat 55', 'Main aim of PRC is to support AEGEE-Europe and it''s locals with tasks related to Public Relations, communications, graphic design, promotion planning and journalism.', 'PRW', '2018-05-03 11:49:47.528604', '2018-05-03 11:49:47.528612', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (8, 'Events Quality Assurance Committee', 'quality.events@aegee.org', NULL, 'Notelaarsstraat 55', 'The Events Quality Assurance Committee’s role is to help and support the Locals in organising quality events. Our goal is to approve the quality and to increase the impact of the European events in AEGEE and outside of it.', 'EVC', '2018-05-02 20:48:36.199812', '2018-05-02 21:00:36.89381', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (9, 'Chair Team of the Agora', 'chair@aegee.org', NULL, 'Notelaarsstraat 55', 'The Chair team is responsible for preparing and moderating the Agorae. They preside over them, take the minutes and are responsible for the IT during the events.', 'XCH', '2018-05-02 20:57:11.731766', '2018-05-02 21:46:30.370472', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (14, 'Corporate & Institutional Relations Committee', 'circ@aegee.org', NULL, 'Notelaarsstraat 55', 'The Corporate & Institutional Relations Committee (CIRC) is a supporting committee of AEGEE-Europe and was established by the Agora Enschede 2012. The tasks of the CIRC are such as  supporting the work of AEGEE-Europe and ensure its financial sustainability providing help, analyse the needs of the Network and European level, supporting the locals on fundraising issues, implementing the fundraising strategy and increase the financial resources of AEGEE-Europe. The CIRC holds an internal and external role and is entitled to act towards the stakeholders of AEGEE-Europe with permission and supervision of the Comité Directeur.', 'CRC', '2018-05-03 08:50:31.434227', '2018-05-03 08:50:43.685164', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (10, 'Civic Education Working Group', 'wg@civiceducation.eu', NULL, 'Notelaarsstraat 55', 'The Civic Education Working Group is coordinating AEGEE''s work on Civic Education. The role is to make sure AEGEE achieves it''s objectives by helping locals with the activities, delivering different workshops during AEGEE events, raising awareness for Civic Education inside and outside our association, following up on the European Citizens'' Initiative and more.', 'CEW', '2018-05-02 21:04:38.277988', '2018-05-03 09:13:48.949268', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (17, 'European Citizenship Working Group', 'ecwg@aegee.org', NULL, 'Notelaarsstraat 55', 'The European Citizenship Working Group is coordinating AEGEE''s work on European Citizenship. This Focus Area has the aim to empower young people to become active and critical European citizens by educating them on the diversity of European cultures and by enabling them to take an active role in shaping the European project.', 'ECW', '2018-05-03 09:18:03.400815', '2018-05-03 09:18:03.400824', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (11, 'AEGEE Election Observation (Project)', 'aeo@aegee.org', NULL, 'Notelaarsstraat 55', 'AEGEE Election Observation organises observation missions to elections in Europe. A typical mission lasts for 7 days and consists of 24 young European observers (any AEGEE member can apply to be an observer). During the mission, they meet politicians, institutions and youth organisations,on election day they observe the voting and vote-counting procedures on the ground. After the mission, they publish a report about the elections - and in particular about the participation of young people in these elections.', 'QEO', '2018-05-02 21:15:35.706482', '2018-05-03 13:58:37.534071', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (25, 'Eastern Partnership Project', 'eap@aegee.org', NULL, 'Notelaarsstraat 55', 'The Eastern Partnership project of AEGEE started in 2011 and since then it became more and more successful. It organises conferences, writes articles, makes interviews and generally tries to raise awareness about the Eastern European Partnership countries to help bringing them closer to the European Union.', 'QEP', '2018-05-03 14:32:37.026934', '2018-05-03 14:32:37.026942', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (26, 'European Planning Meeting', 'projects@aegee.org', NULL, 'Notelaarsstraat 55', 'The European Planning Meeting (EPM) is the annual thematic conference of AEGEE-Europe, providing a space for the Network to exchange views and ideas on the Focus Areas of the Strategic Plan and any other topic considered relevant.', 'QEC', '2018-05-03 14:51:15.551759', '2018-05-03 14:51:15.551768', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (1, 'AEGEE-Dresden', 'info@aegee-dresden.org', 'don''t call us', 'Dresden', 'Very prehistoric antenna', 'DRE', '2018-05-02 18:01:11.553103', '2018-05-04 00:17:56.66627', 7);
