INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (56, 'AEGEE-Bucureşti', 'bucuresti@aegee.org', NULL, 'Frumoasa Street, nr 31, sector 1, Bucharest, Romania (Bucureşti, Romania)', 'Local in Bucureşti, see also http://www.aegee-bucuresti.ro/', 'BUH', '2018-05-14 08:57:22.696173', '2018-05-14 08:57:22.69619', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (16, 'Equal Rights Working Group', 'thedodora.giakoumelou@aegee.org', NULL, 'Notelaarsstraat 55', 'The Equal Rights Working Group is coordinating AEGEE''s work on Equal Rights. The focus area has the aim to acknowledge and tackle discrimination based on gender identity, expression and sexual orientation, promoting equity from an intersectional perspective.', 'ERW', '2018-05-03 09:11:02.575987', '2018-05-03 09:12:36.166125', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (20, 'Information Technology Committee', 'itc@aegee.org', NULL, 'Notelaarsstraat 55', 'The Information Technology Committee (ITC) is a supportive body of AEGEE-Europe. It’s primary aim is to help AEGEE with anything related to IT. The Information Technology Committee is divided in several informal Teams that act fairly independent.', 'IUG', '2018-05-03 10:00:35.286371', '2018-05-03 10:00:35.286379', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (23, 'Europe on Track Project', 'europeontrack@aegee.org', NULL, 'Notelaarsstraat 55', 'Europe on Track is a youth-led project where nine young ambassadors cross Europe with InterRail passes for one month, informing and interviewing young people about their vision of the Europe of tomorrow. In order to do so, they participate in local events bringing content and creating spaces for dialogue and discussion with a main focus that changes every year, achieving a bigger impact through a travel blog, videos and social media.', 'QET', '2018-05-03 12:03:32.888134', '2018-05-03 12:03:32.888142', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (24, 'YVote 2019 Project', 'philipp.blum@aegee-aachen.org', NULL, 'Notelaarsstraat 55', 'The Y Vote project strives to inform people in Europe, especially the youth, in order to equip them with the needed knowledge and to encourage them to be engaged in the democratic process in the future.', 'E19', '2018-05-03 14:21:44.708395', '2018-05-03 14:21:44.708403', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (18, 'Youth Development Working Group', 'ydwg@aegee.org', NULL, 'Notelaarsstraat 55', 'The Youth Development Working Group is coordinating AEGEE''s work on Youth Development. This Focus Area has the aim to provide young people with opportunities to gain transversal skills and competences that contribute to their personal and professional development.', 'YDW', '2018-05-03 09:26:59.517405', '2018-05-03 09:26:59.517413', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (15, 'Human Resources Committee', 'hrc@aegee.org', NULL, 'Notelaarsstraat 55', 'The mission of the Human Ressources Committee is to support and educate the Network of AEGEE in the field of Human Resources Management (HRM/HR). It coordinates the implementation of a tailored HR cycle according to the needs of AEGEE and assist any local and European Body in need of guidance. Through Internal education, we ensure that the new members who enter AEGEE receive all necessary skills and knowledge to rise inside the Network in any positions they wish to. Finally, we bring value to the AEGEE Network by providing mentoring and guidance to the locals and European Bodies, and supporting them in creating a sustainable and effective working atmosphere inside their teams.', 'HRC', '2018-05-03 09:01:01.866512', '2018-05-03 09:50:22.786819', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (19, 'Summer University Project', 'suct@aegee.org', NULL, 'Notelaarsstraat 55', 'The Summer University Project is centrally coordinated by the Summer University Coordination Team. The SUCT is a team of four AEGEE-members from different parts of Europe plus one appointed Comité Directeur member.', 'QSU', '2018-05-03 09:55:50.767773', '2018-05-03 09:57:20.089642', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (21, 'The AEGEEan Magazine Committee', 'aegeean@aegee.org', NULL, 'Notelaarsstraat 55', 'The AEGEEan is the official magazine of AEGEE. It was founded to be the place for members to access relevant news about our organisation, and to be the place for people to share their AEGEE experience: a magazine of, by, and for members of AEGEE.', 'QAE', '2018-05-03 11:43:27.889188', '2018-05-03 11:44:26.46757', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (27, '30 Years of SU Project', 'su30@aegee.org', NULL, 'Notelaarsstraat 55', 'The main aim of the 30th anniversary project is to assess how the Summer University project is currently seen and subsequently identify its present as well as future identity.', 'S30', '2018-05-03 16:38:53.307715', '2018-05-03 16:38:53.307723', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (29, 'Les Anciens', 'anciens-board-l@aegee.org', NULL, 'Europe', 'Les Anciens d’AEGEE is the alumni organisation for former AEGEE members. It organises regular events where members meet and supports AEGEE when and where possible.', 'XAN', '2018-05-03 17:16:52.596163', '2018-05-03 17:16:52.596171', NULL);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (28, 'Honorary Members', 'president@aegee.org', NULL, 'Notelaarsstraat 55', 'Honorary Members are individuals, having performed outstanding service for the community of AEGEE-Europe, upon whom the Association desires to confer special distinction.', 'XHO', '2018-05-03 17:04:46.066781', '2018-05-03 17:04:46.06679', NULL);
