INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (30, 'AEGEE-Aachen', 'vorstand@aegee-aachen.org', '+49 241 8097121', 'Rochusstr. 2-14, 52062 Aachen, Deutschland', 'AEGEE-Aachen was founded 30 years ago striving for a borderless Europe. It was around that time when the Erasmus project was established.', 'AAC', '2018-05-04 20:35:22.599703', '2018-05-14 09:24:02.037395', 60);
INSERT INTO bodies (id, name, email, phone, address, description, legacy_key, inserted_at, updated_at, shadow_circle_id) VALUES (2, 'Comité Directeur', 'cd@aegee.org', NULL, 'Notelaarsstraat 55, 1000 Brussel, Belgium', 'The Comité Directeur is the European Board of Directors. It administers the association and is composed of a maximum of seven members by the General Assembly for the term of one year. The Comité Directeur is vested with the widest possible powers to act in the name of the association.', 'XEU', '2018-05-02 19:03:42.916437', '2018-05-14 11:46:16.789704', 16);
