INSERT INTO permissions (id, scope, action, object, description, always_assigned, filters, inserted_at, updated_at) VALUES (7, 'global', 'update', 'circle', 'Update any circle, even those that you are not in a circle_admin position in. Should only be assigned in case of an abandoned toplevel circle as circle_admins automatically get this permission', false, '{}', '2018-05-03 23:12:00.347851', '2018-05-03 23:12:00.34786');
INSERT INTO permissions (id, scope, action, object, description, always_assigned, filters, inserted_at, updated_at) VALUES (8, 'global', 'put_parent', 'circle', 'Assign a parent to any circle. This permission should be granted only to trustworthy persons as it is possible to assign an own circle as child to a parent circle with a lot of permissions', false, '{}', '2018-05-03 23:12:00.354194', '2018-05-03 23:12:00.354201');
INSERT INTO permissions (id, scope, action, object, description, always_assigned, filters, inserted_at, updated_at) VALUES (9, 'local', 'put_parent', 'bound_circle', 'Assign a parent to a bound circle. This only allows to assign parents that are in the same body as the circle to migitate permission escalations where someone with this permission could assign his own circle to one with a lot of permissions', false, '{}', '2018-05-03 23:12:00.365641', '2018-05-03 23:12:00.365649');
