INSERT INTO permissions (id, scope, action, object, description, always_assigned, filters, inserted_at, updated_at) VALUES (11, 'global', 'view_members', 'circle', 'View members of any circle, even those you are not member of. Should only be given to very trusted people as this way big portions of the members database can be accessed directly', false, '{}', '2018-05-03 23:12:00.389374', '2018-05-03 23:12:00.389381');
