INSERT INTO permissions (id, scope, action, object, description, always_assigned, filters, inserted_at, updated_at) VALUES (13, 'global', 'add_member', 'circle', 'Add anyone to any circle in the system, no matter if the circle is joinable or not but still respecting that bound circles can only hold members of the same body. This also allows to add yourself to any circle and thus can be used for a privilege escalation', false, '{}', '2018-05-03 23:12:00.407025', '2018-05-03 23:12:00.407034');
INSERT INTO permissions (id, scope, action, object, description, always_assigned, filters, inserted_at, updated_at) VALUES (14, 'local', 'add_member', 'circle', 'Add any member of the body you got this permission from to any bound circle in that body, no matter if the circle is joinable or not or if the member wants that or not. This also allows to add yourself to any circle so only give it to people who anyways have many rights in the body', false, '{}', '2018-05-03 23:12:00.414408', '2018-05-03 23:12:00.414415');
INSERT INTO permissions (id, scope, action, object, description, always_assigned, filters, inserted_at, updated_at) VALUES (15, 'global', 'update_members', 'circle', 'Update membership details of members of any circle, even those that you are not in a circle_admin position in or even have member status. Should never be assigned as circle_admins automatically get this permission', false, '{}', '2018-05-03 23:12:00.424434', '2018-05-03 23:12:00.424443');
