INSERT INTO permissions (id, scope, action, object, description, always_assigned, filters, inserted_at, updated_at) VALUES (44, 'local', 'update', 'member', 'Update any member in the body you got this permission from. Notice that member information is global and several bodies might have the permission to access the same member. Also don''t assign it when not necessary, the member can update his own profile anyways.', false, '{}', '2018-05-03 23:12:00.734937', '2018-05-03 23:12:00.734946');
