INSERT INTO permissions (id, scope, action, object, description, always_assigned, filters, inserted_at, updated_at) VALUES (46, 'local', 'delete', 'user', 'Delete any member in your body from the system. This allows to also delete members that are in other bodies and have a quarrel in that one body with the board admin, so be careful in granting this permission. The member can delete his own profile anyways', false, '{}', '2018-05-03 23:12:00.751909', '2018-05-03 23:12:00.751915');
INSERT INTO permissions (id, scope, action, object, description, always_assigned, filters, inserted_at, updated_at) VALUES (47, 'global', 'update_active', 'user', 'Allows to suspend or activate any user in the system', false, '{}', '2018-05-03 23:12:00.760365', '2018-05-03 23:12:00.760372');
INSERT INTO permissions (id, scope, action, object, description, always_assigned, filters, inserted_at, updated_at) VALUES (53, 'local', 'create', 'member', 'Creates a member to the local that this permission was granted in', false, '{}', '2018-05-04 13:47:55.051022', '2018-05-04 13:47:55.051032');
